    discription:
      "We all are admirers of the Marvel serives and especially Tony Stark's a.k.a Iron Man's assistaant JARVIS. It stands for 'Just A Rather Very Intelligent System'. We have all dreamt of having one Jarvis for our whole lives. So, why not start by building one elementary Jarvis ourselves. Though the actual Jarvis is built using AI, we will built a simple Jarvis using Python.",
